export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:b,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:b,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:c,pageSize:25,pageCount:c,total:5}}},sTpdN2Vnbq:{data:{id:2779,attributes:{imdbId:"tt7014378",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzRlY2UwYTEtMjUwMC00MjFhLWFhZTAtODBhY2U5MDhmMzY3XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"100%"},{Source:"Metacritic",Value:"78\u002F100"}],item_lang:{data:{id:3446,attributes:{title:d,plot:"Were George Mallory and his companion Andrew Irvine the first men to scale Everest on June 8th, 1924? Only the little Kodak camera they took with them might reveal the truth. In Kathmandu 70 years later, a young Japanese reporter named Fukamachi recognizes the camera in the hands of the mysterious Habu JÃ´ji, an outcast climber believed missing for years. Fukamachi enters a world of obsessive mountaineers hungry for impossible conquests on a journey that leads him, step by step, towards the summit of the gods.",slug:"the-summit-of-the-gods"}}},books:{data:[{id:13205,attributes:{title:d,description:"On his third Everest expedition in June 1924, George Mallory and his climbing partner Andrew Irvine disappeared on the North-East ridge during their ascent - having been sighted only a few hundred metres from the summit. Makoto Fukamachi, photographer and mountaineer, continues his search for Habu Joji and the camera which could hold the secret to Mallory's attempt. His quest takes him high into Nepal to the town of Namche Bazar, capital of Sherpa country. Taniguchi's realistic art and Baku's timeless script will take readers to the heights mountaineers can only dream of.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Mw7kQAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Baku",e,f],firstBook:true,published:"2012-06-01",publisher:g,subtitle:h}},{id:13206,attributes:{title:"The Summit of the Gods 5",description:"ANOTHER SUMMIT The scene is finally set for Habu's challenge of the South West face of Everest in winter, solo and without oxygen. Fukamachi has accompanied him so far but must now descend to base camp and leave the mountain to Habu. Will Habu make the summit? Will Fukamachi solve the riddle of Mallory's camera? This action packed and nerve jangling culmination to this epic story will leave you just as breathless as if you had climbed Everest yourself!! Now over 90 years since Mallory and Irvine's disappearance on the mountain in 1924, and over 15 years since Mallory's body was found there. Irvine is still missing and SO IS THE CAMERA that could tell the world if they ever made the summit. Taniguchi's realistic art and Baku's tireless script will take you to such heights that mountaineers only dream of - and may not bring you back! -- Yumemakura Baku and Jiro Taniguchi",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ko62oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e,f],firstBook:i,published:"2015-03-26",publisher:g,subtitle:"Comic Adaptation of Baku's Original Novel"}},{id:13207,attributes:{title:"Harukana Machie",description:"Hiroshi Nakahara is a forty-something salary man returning to Tokyo from an intense business trip when he is catapulted back into his fourteen year-old life and body whilst retaining all the character and experience of the adult. Will he change his past or be forever condemned to relive each painful moment? That fateful day his father disappeared without explanation, the death of his mother ... would he marry his childhood sweetheart and never see his wife and daughters again? Master manga-ka Taniguchi at his most powerful.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MjfRzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["JIRO. TANIGUCHI"],firstBook:i,published:"2022-08-14",publisher:h,subtitle:"A Distant Neighborhood"}}]}}},meta:{}}},prerenderedAt:1681377163414}}("movie","series",1,"The Summit of the Gods","Yumemakura Baku","Jiro Taniguchi","Ponent Mom S L","",false))